// App.js
import React from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import './App.css';

const App = () => {
  const [center, setCenter] = React.useState({
    lat: 37.5665, 
    lng: 126.9780
  });

  const mapStyles = {
    height: "100vh",
    width: "100%"
  };

  return (
    <div className="app-container">
      <header className="search-bar">
        <button className="back-button">
          <img src="/icons/back.svg" alt="뒤로가기" />
        </button>
        <input type="text" placeholder="시설명 혹은 주소 검색" />
      </header>

      <LoadScript googleMapsApiKey={AIzaSyBR3XR176Wj4TBWWcH2qY_tungtmqpofVw}>
        <GoogleMap
          mapContainerStyle={mapStyles}
          zoom={15}
          center={center}
        >
          <Marker position={center} icon="/icons/custom-marker.svg" />
        </GoogleMap>
      </LoadScript>
    </div>
  );
};

export default App;
